import React from 'react';
import './TimeTracker.css';

interface TimeTrackerProps {
  user: { firstName: string; lastName: string };
  onLogout: () => void;
}

const TimeTracker: React.FC<TimeTrackerProps> = ({ user, onLogout }) => {
  const handleTimeIn = () => {
    // TODO: integrate with backend time-in endpoint
    alert('Time In recorded');
  };

  const handleTimeOut = () => {
    // TODO: integrate with backend time-out endpoint
    alert('Time Out recorded');
  };

  return (
    <div className="time-page">
      <div className="time-topbar">
        <div className="time-brand">
          <div className="brand-logo" aria-hidden>
            <svg viewBox="0 0 64 64" width="36" height="36" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M24 56h16" stroke="#0b5161" strokeWidth="4" strokeLinecap="round"/>
              <path d="M32 8c-9.389 0-17 7.611-17 17 0 6.06 3.087 11.382 7.78 14.5 1.689 1.114 2.22 2.654 2.22 4.5v2h16v-2c0-1.846.531-3.386 2.22-4.5C45.913 36.382 49 31.06 49 25c0-9.389-7.611-17-17-17Z" stroke="#0b5161" strokeWidth="3"/>
              <path d="M26 42h12" stroke="#0b5161" strokeWidth="3" strokeLinecap="round"/>
            </svg>
          </div>
          <div className="brand-text">
            <div className="brand-title"><span className="brand-strong">ClaUSys</span></div>
            <div className="brand-subtitle">Classroom Utilization System</div>
          </div>
        </div>
        <div className="time-user">
          <span className="user-name">{user.firstName} {user.lastName}</span>
          <span className="user-avatar" aria-hidden>üë§</span>
        </div>
      </div>

      <div className="time-content">
        <div className="time-actions">
          <button className="btn-time btn-in" onClick={handleTimeIn}>
            <span className="icon" aria-hidden>‚úî</span>
            <span>Time In</span>
          </button>
          <button className="btn-time btn-out" onClick={handleTimeOut}>
            <span className="icon" aria-hidden>‚è∞</span>
            <span>Time Out</span>
          </button>
        </div>

        <button className="btn-logout" onClick={onLogout}>Logout</button>
      </div>
    </div>
  );
};

export default TimeTracker;
